import WaitingParty from './components/WaitingParty';
import WaitingList from './components/WaitingList';
import CreateParty from './components/CreateParty';

function App() {
    const parties = {
            "name": "Sam",
                        "size": 3,
                        "phoneNumber": 7813836375,
                        "quotedTime": "7:45 PM",
                        "notes": "N/A"
    }

    return (
        <div className='app'>
             <WaitingParty name={"Sam"} size={3} phoneNumber={7813836375} quotedTime={"7:45 PM"} notes={"N/A"} />
             <WaitingParty name={"Sam"} size={3} phoneNumber={7813836375} quotedTime={"7:45 PM"} notes={"N/A"} />
             <WaitingList parties={parties}/>
             <CreateParty />
        </div>

    );
}

export default App;
